import React from "react";
import { Fragment } from "react";
const Contact = () => {
	return (
		<Fragment>
			<h1>Contact Me</h1>
			<div className="container-flex">
				<form>
					<div>
						<div>
							<label className="form-label" for="Name">
								Name
							</label>
							<input
								type="text"
								className="form-control"
								id="Name"
								aria-describedby="NameHelp"
							/>
							<div id = "NameHelp" className= "form-text">A name you prefer to be adressed as</div>
						</div>
					</div>
					<div></div>
				</form>
			</div>
		</Fragment>
	);
};

export default Contact;
